DROP TABLE IF EXISTS `sys_service`;
CREATE TABLE `sys_service` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `service_name` varchar(500) DEFAULT NULL COMMENT '服务名称',
  `node_code` varchar(200) DEFAULT NULL COMMENT '节点编码',
